  f2 <- function(){
    NULL
  }

  f3 <- function(x1,x2,x3){
    x1 + x2 + x3
  }

  f4 <- function(x1 = message, x2 = warning, x3 = stop){x1("m"); x2("w"); x3("e")}

  set_test_seed(98)

