  expect_equal(
    length(output_12655),
    1L)
  # Testing sum of element lengths
  expect_equal(
    sum(xpectr::element_lengths(output_12655)),
    1L)
  ## Finished testing 'fn()'                                                ####

  set_test_seed(1)

  ## Testing 'fn(raise = TRUE)'                                             ####
  ## Initially generated by xpectr
  xpectr::set_test_seed(42)
  # Testing side effects
  expect_error(
    xpectr::strip_msg(fn(raise = TRUE)),
